import React from 'react'
import ISLogo from "/Users/rick/Git/EcoTrackFront-End/ecotrack-frontend/src/img/infosyslogo.png";
import { makeStyles } from '@mui/styles';

const sideMenuStyle = makeStyles({
    sideMenu: {
        display: 'absolute',
        flexDirection: 'column',
        position: 'absolute',
        left: '0px',
        width: '320px',
        height: '100%',
        backgroundColor: '#F1F2ED'
    }
})

export default function footer() {
  return (
    <img src={ISLogo}></img>
  )
}
